import React,{useState} from 'react';
import { Chart } from 'react-google-charts';
import {HiTrendingUp} from "react-icons/hi"; 
import styles from "./AreaCard.module.css";

export default function AreaCard({work,number,profit}) {
 return (
     <>
     <div className={styles.chart} id="chart">
       <p>{work}</p> 
       <div style={{display:"flex"}}>
        <div>
            <div style={{display:"flex",flexDirection:"column",alignItems:"center"}}>
            <h5>{number}</h5>
            {profit?(
            <div style={{height:"15px",width:"15px",background:"#98d490"}}><HiTrendingUp color='#055e0e'/></div>
            ):(
            <div style={{height:"15px",width:"15px",background:"#e8898f"}}><HiTrendingUp color='#7d0c14'/></div>
              )
             }
            </div>
        </div>  
        <ReactApexChart options={state.options} series={state.series} type="area" height={100} />
       </div>
   
     </div>
     </>
     )
}
